# 448. Find All Numbers Disappeared in an Array
class Solution(object):
    def findDisappearedNumbers(self, nums):
        """
        :type nums: List[int]
        :rtype: List[int]
        """
        i, j = 0, 1
        nums.sort()
        output = []
        while i < len(nums):
            if nums[i] == j:
                i += 1
                j += 1
            elif nums[i] > j:
                output.append(j)
                j += 1
            elif nums[i] < j:
                i += 1

        while j <= len(nums):
            output.append(j)
            j += 1
        return output


sol = Solution()
nums = [4, 3, 2, 7, 8, 2, 3, 1]
nums = [4, 4, 4, 4, 4, 4, 4, 4]
sol.findDisappearedNumbers(nums)


class Solution(object):
    def findDisappearedNumbers(self, nums):
        """
        :type nums: List[int]
        :rtype: List[int]
        """
        # For each number i in nums,
        # we mark the number that i points as negative.
        # Then we filter the list, get all the indexes
        # who points to a positive number
        for i in range(len(nums)):
            index = abs(nums[i]) - 1
            nums[index] = - abs(nums[index])

        return [i + 1 for i in range(len(nums)) if nums[i] > 0]

sol = Solution()
nums = [4, 3, 2, 7, 8, 2, 3, 1]
# nums = [4, 4, 4, 4, 4, 4, 4, 4]
sol.findDisappearedNumbers(nums)

class Solution(object):
    def twoSum(self, numbers, target):
        """
        :type numbers: List[int]
        :type target: int
        :rtype: List[int]
        """
        uniqNums = set(numbers)
        for firstNum in uniqNums:
            secondNum = target-firstNum
            if firstNum != secondNum and secondNum in uniqNums-set([firstNum]):  # set(12) is incorrect because 12 is not an interable. set must be applied on an iterable.
                break
            elif firstNum == secondNum and numbers.count(firstNum) >= 2:
                break
        
        if firstNum > secondNum: firstNum, secondNum = secondNum, firstNum
        
        i, idx1, idx2 = 0, 0, 0
        
        while idx1 == 0 or idx2 == 0:
            if numbers[i] == firstNum:
                idx1 = i + 1
            if numbers[i] == secondNum:
                idx2 = i + 1
            i += 1
        
        if idx2 == idx1: idx2 += 1
        
        return [idx1, idx2]
        

