# 415. Add Strings
class Solution(object):
    def addStrings(self, num1, num2):
        """
        :type num1: str
        :type num2: str
        :rtype: str
        """
        i, j = len(num1)-1, len(num2)-1
        carry = 0
        l = []
        while i >= 0 and j >= 0:
            singleSum = int(num1[i]) + int(num2[j]) + carry
            l.append(str(singleSum % 10))
            carry = singleSum // 10
            i -= 1
            j -= 1
        while j >= 0:
            singleSum = int(num2[j]) + carry
            l.append(str(singleSum % 10))
            carry = singleSum // 10
            j -= 1
        while i >= 0:
            singleSum = int(num1[i]) + carry
            l.append(str(singleSum % 10))
            carry = singleSum // 10
            i -= 1
        if carry != 0:
            l.append(str(carry))
        return ''.join(list(reversed(l)))

# 202. Happy Number
class Solution(object):
    def isHappy(self, n):
        """
        :type n: int
        :rtype: bool
        """
        curNum = n
        nums = set([n])
        while True:
            total = 0
            while curNum > 0:
                total += (curNum % 10) ** 2
                curNum //= 10
            if total == 1:
                return True
            elif total in nums:
                return False
            else:
                curNum = total
